import { ADDWORD } from '../actions'

const initialState = { word: 'test' }

export default (state = initialState, action) => {
    switch (action.type) {
        case ADDWORD:
            const adsf = state.word + 'bbbb';

            return {adsf}
        default:
            return state
    }
}
